import React from 'react'
import Button from '@material-ui/core/Button';
import Icon from '@material-ui/core/Icon';
import FolderIcon from '@material-ui/icons/Folder';

function Folder() {
    return (
        <div>
            <Button 
            variant="contained"
            color="primary"
            endIcon={<FolderIcon/>}
            >

            </Button>
        </div>
    )
}

export default Folder
